import React, { useState } from "react";
import "../css/navigationBar.css";

export const NavigationButtons = ({ name, onClickEvent, customStyle }) => {
  const [bgColor, setBgColor] = useState("#333647");
  const leaveFunction = () => {
    setBgColor("#333647");
  };
  const enterFunction = () => {
    setBgColor("#242834");
  };
  const clickFunction = () => {
    onClickEvent();
    setBgColor("#");
  };
  return (
    <button
      className="item nav-button"
      onMouseDown={onClickEvent}
      onMouseLeave={leaveFunction}
      onMouseEnter={enterFunction}
      style={customStyle}
    >
      {name}
    </button>
  );
};
